import React from "react";
import s from './Navbar.module.css'
import {Link} from 'react-router-dom'


const Navbar=()=>{
    return <nav className={s.nav}>
      <div id="navbar">
  <a href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
</div>
    </nav>
}

export default Navbar;
